(14248, 'BINGXII', 'XIIBING', 1, 16, '', 'Toronto is one of the largest cities in Canada. It is located in the province of Ontario. The special feature of Toronto is their downtown area that is located underground. It covers about twelve square kilometers with many shops and buildings. There are five major shopping centers and a convention center with hotels. A subway and underground passageways connect these buildings with each other and the street above. \nThe citys architectural design is up to date and suits the weather in Toronto since the temperature fluctuates widely from summer to winter by as much as 40 degrees celcius within a year. This underground area has also helped to keep business in the city center instead of moving out to the suburbs, which is happening in many other cities. We think that makes Toronto a special place. What is the benefit of reading this information for people who visit the city for the first time?\n\n', '', '', '', ' The visitor will know the best place to shop', 'They will know the best feature of Torontoe ', 'They can navigate the city better with subway', 'They will know the best season to visit Toronto', '', '', '', '', '', '', '2', 1, 'T', 'T', '', '', '', ''),
(14249, 'BINGXII', 'XIIBING', 1, 17, '', 'Toronto is one of the largest cities in Canada. It is located in the province of Ontario. The special feature of Toronto is their downtown area that is located underground. It covers about twelve square kilometers with many shops and buildings. There are five major shopping centers and a convention center with hotels. A subway and underground passageways connect these buildings with each other and the street above. \nThe citys architectural design is up to date and suits the weather in Toronto since the temperature fluctuates widely from summer to winter by as much as 40 degrees celcius within a year. This underground area has also helped to keep business in the city center instead of moving out to the suburbs, which is happening in many other cities. We think that makes Toronto a special place..What so special about Toronto as a city?', '', '', '', 'Its city center is located underground', 'It has a lot of shops and shopping centers', 'The weather is steady in 40 degrees celcius', 'Its location is recently moved to the suburbs.', '', '', '', '', '', '', '1', 1, 'T', 'T', '', '', '', ''),
(14250, 'BINGXII', 'XIIBING', 1, 18, '', ' It is located in the province of Ontario. The special feature of Toronto is their downtown area that is located underground. It covers about twelve square kilometers with many shops and buildings. There are five major shopping centers and a convention center with hotels. A subway and underground passageways connect these buildings with each other and the street above. \nThe citys architectural design is up to date and suits the weather in Toronto since the temperature fluctuates widely from summer to winter by as much as 40 degrees celcius within a year. This underground area has also helped to keep business in the city center instead of moving out to the suburbs, which is happening in many other cities. The temperature fluctuates widely from summer to winter\nThe underlined word can also be replaced by ....\n', '', '', '', 'brings', 'crashes', 'changes', 'escalates', '', '', '', '', '', '', '3', 1, 'T', 'T', '', '', '', ''),
(14251, 'BINGXII', 'XIIBING', 1, 19, '', 'Victoria Caroline Beckham is an English singer-songwriter, dancer, model, actress, fashion designer and businesswoman. She was born on April 17, 1974, in Essex, England. She became famous in the 1990s with the pop group The Spice Girls and was known as Posh Spice. In 1999, she married the Manchester United and England footballer, David Beckham. They have four children, three sons and a daughter.\nAfter The Spice Girls split up, she pursued a solo singing career, but also started her own fashion range called dVb Style. Since this initial foray into fashion Victoria Beckham has brought out her own range of sunglasses and fragrance, entitled intimately Beckham and a range of handbags and jewelry.\nIn addition she had written two best-selling books : one her autobiography and the other, a fashion guide.\nTaken from: http://kesidamayanti.blogspot.co.id/2015/07/soal-soal-xi-biography.html. 14th February 2017\nBased on the text, what do we know about Victoria?', '', '', '', 'She married an ordinary person', 'She is a multi-talented woman', ' She designed The Spice Girls.', 'She is an ordinary woman', '', '', '', '', '', '', '2', 1, 'T', 'T', '', '', '', ''),
(14252, 'BINGXII', 'XIIBING', 1, 20, '', '14th February 2017\nFrom the text, we can infer that Victoria became famous since she ....\n', '', '', '', 'sang with The Spice Girls ', ' wrote an autobiography', 'started her solo career', ' had four children', '', '', '', '', '', '', '1', 1, 'T', 'T', '', '', '', ''),
(14253, 'BINGXII', 'XIIBING', 1, 21, '', '<p>Questions no 21refer to the following text. Follow these steps to upload your video to YouTube successfully:<br /> &bull; First, convert your video into a proper format accepted by YouTube, such as .AVI, .3GPP, .MP4, .MPEG and save it to your computer.<br /> &bull; Second, log in to your YouTube account.<br /> &bull; Then find the upload button on the right side of the Search bar and click it. <br />&bull; Click the &ldquo;select files to upload&rdquo; button and find the file that you want to add. After choosing the file, click the Open button. <br />&bull; When the file is successfully uploaded, give it a title and description. Remember that the details had better give clear information. <br />&bull; Set your privacy by determining who can see your account.<br /> When you have finished with your privacy setting, click &ldquo;save changes&rdquo; button..What should we do before saving our video to the computer?</p>', '', '', '', '<p>Log in to our YouTube account</p>', '<p>Convert our video to the proper format</p>', '<p>Find the &ldquo;upload button&rdquo; on the screen</p>', '<p>Give a title and description to the video</p>', '', '', '', '', '', '', '2', 1, 'T', 'T', '', '', '', ''),
(14254, 'BINGXII', 'XIIBING', 1, 22, '', '<p>Questions no 21refer to the following text. Follow these steps to upload your video to YouTube successfully:<br />&bull; First, convert your video into a proper format accepted by YouTube, such as .AVI, .3GPP, .MP4, .MPEG and save it to your computer.<br />&bull; Second, log in to your YouTube account.<br />&bull; Then find the upload button on the right side of the Search bar and click it.&nbsp;<br />&bull; Click the &ldquo;select files to upload&rdquo; button and find the file that you want to add. After choosing the file, click the Open button.&nbsp;<br />&bull; When the file is successfully uploaded, give it a title and description. Remember that the details had better give clear information.&nbsp;<br />&bull; Set your privacy by determining who can see your account.<br />When you have finished with your privacy setting, click &ldquo;save changes&rdquo; button..What should we do before saving our video to the computer?When you have finished with your privacy setting, click &ldquo;save changes&rdquo; button.&ldquo;...and save it to your computer...&rdquo; (line 3) The word &ldquo;it&rdquo; refers to ....</p>', '', '', '', '<p>YouTube</p>', '<p>MPEG</p>', '<p>format</p>', '<p>video</p>', '', '', '', '', '', '', '4', 1, 'T', 'T', '', '', '', ''),
(14255, 'BINGXII', 'XIIBING', 1, 23, '', '<p>Question no 23 refer to the following dialog<br /> Bimo : Did you watch the football game last night? <br />Sanny : I had no time. The meeting lasted until very late at night. <br />Bimo : That&rsquo;s too bad. The game was very tough, but finally my favorite team won.<br /> Sanny : I wish I had watched it. It was the game I had waited for. <br />Bimo : What time did you arrive at home, anyway? <br />Sanny : At eleven. Can you imagine how tired I was? <br />What does Bimo think about the game?</p>', '', '', '', '<p>It was a very bad game</p>', '<p>It lasted until late at night.</p>', '<p>It was the most waited game.</p>', '<p>It was hard but the result was good</p>', '', '', '', '', '', '', '4', 1, 'T', 'T', '', '', '', ''),
(14256, 'BINGXII', 'XIIBING', 1, 24, '', '<p>Question refers to the following dialog. <br />Danny : My mother loves her job very much.<br /> Ally : What does she do? <br />Danny : She&rsquo;s a teacher. She is very dedicated to her job. Her students really respect her as a patient brilliant teacher. <br />Ally : Wow! The students are lucky to have her. <br />From the dialogue, we know that ....</p>', '', '', '', '<p>Danny is a dedicated teacher</p>', '<p>Danny really respects his teacher</p>', '<p>Danny&rsquo;s mother is a good teacher</p>', '<p>Ally is lucky to have a good teacher</p>', '', '', '', '', '', '', '3', 1, 'T', 'T', '', '', '', ''),
(14257, 'BINGXII', 'XIIBING', 1, 25, '', '<p>Choose the appropriate expression to complete the dialog. 25. <br />Pevita : Shall we go to the movies together? <br />Nirina : .... I&rsquo;ll make the popcorn and orange juice. <br />Pevita : That&rsquo;s a good idea. I have some new films.</p>', '', '', '', '<p>I&rsquo;d rather watch the movie</p>', '<p>I suggest that we stay at home</p>', '<p>We&rsquo;d better have lunch at home</p>', '<p>Why don&rsquo;t we watch DVD at home?</p>', '', '', '', '', '', '', '4', 1, 'T', 'T', '', '', '', ''),
(14258, 'BINGXII', 'XIIBING', 1, 26, '', '<p>Emily : The government should control the use of online games in our country.<br /> Henry : .... Some games can cause addiction and lead the children to bad behavior. <br />Rosita : Indeed. It causes a serious damage to human&rsquo;s brain</p>', '', '', '', '<p>I don&rsquo;t think so</p>', '<p>That&rsquo;s not right</p>', '<p>I have a different opinion</p>', '<p>That&rsquo;s exactly what I think</p>', '', '', '', '', '', '', '4', 1, 'T', 'T', '', '', '', ''),
(14259, 'BINGXII', 'XIIBING', 1, 27, '', '<p>Choose the appropriate expression to complete the dialog.<br /> Robyn : I heard your team just won the basketball competition. <br />Erwin : Yes, it was hard to believe we finally won. Our opponent was very tough.<br /> Robyn : .... You deserve to be the champion.</p>', '', '', '', '<p>Good luck</p>', '<p>Well done!</p>', '<p>How beautiful!</p>', '<p>What a competition!</p>', '', '', '', '', '', '', '2', 1, 'T', 'T', '', '', '', ''),
(14260, 'BINGXII', 'XIIBING', 1, 28, '', '<p>Choose the appropriate expression to complete the dialog. <br />Richie : I can&rsquo;t stand any longer. This cold is getting worse. <br />Victoria : .... It will help relieve your throat. <br />Richie : Thanks. I really appreciate it.</p>', '', '', '', '<p>Would you like to take a rest?</p>', '<p>You should go to the hospital</p>', '<p>I&rsquo;ll make you hot orange drink</p>', '<p>How about having a surgery?</p>', '', '', '', '', '', '', '3', 1, 'T', 'T', '', '', '', ''),
(14261, 'BINGXII', 'XIIBING', 1, 29, '', '<p>Choose the appropriate expression to complete the dialog <br />Indria : How can I forget that I have a test today? I&rsquo;m so forgetful these days. <br />Maharani : If you arranged your schedule well, .... <br />Indria : Thanks for your advice.</p>', '', '', '', '<p>you would not have missed the plan</p>', '<p>you would remember what to do</p>', '<p>you will be on time in every test</p>', '<p>you can do your test more easily</p>', '', '', '', '', '', '', '2', 1, 'T', 'T', '', '', '', ''),
(14262, 'BINGXII', 'XIIBING', 1, 30, '', '<p>Choose the appropriate expression to complete the dialo 30. <br />Vivi : I&rsquo;m going to the minimarket. Do you need anything? <br />Intan : Can you buy a pack of instant spaghetti? I want to make it for dinner. <br />Vivi : Okay, ....</p>', '', '', '', '<p>I will buy it for you</p>', '<p>I want to buy it for you</p>', '<p>I need to buy it for you</p>', '<p>I was going to buy it for you</p>', '', '', '', '', '', '', '1', 1, 'T', 'T', '', '', '', ''),
(14263, 'BINGXII', 'XIIBING', 1, 31, '', '<p>Choose the appropriate expression to complete the dialogue. <br />Anissa : Look at this leather bag! I think it will look good on you. <br />Catherine : If I have a lot of money, .... <br />Anissa : Yeah, it must be very expensive.</p>', '', '', '', '<p>I would buy it for you</p>', '<p>I don&rsquo;t want to buy any</p>', '<p>I will buy the brown one</p>', '<p>I would have bought one</p>', '', '', '', '', '', '', '3', 1, 'T', 'T', '', '', '', ''),
(14264, 'BINGXII', 'XIIBING', 1, 32, '', '<p>Choose the appropriate expression to complete the dialogue<br /> Vina : How about taking a short trip to Greece with me? <br />Kirana : Thanks, but I have a bought a ticket. .... <br />Vina : Why didn&rsquo;t you tell me? You know how I would love to see Eiffel Tower.</p>', '', '', '', '<p>I wanted to visit Paris</p>', '<p>Perhaps I&rsquo;ll go to Paris</p>', '<p>I think I may go to Paris</p>', '<p>I am going to leave for Paris</p>', '', '', '', '', '', '', '4', 1, 'T', 'T', '', '', '', ''),
(14265, 'BINGXII', 'XIIBING', 1, 33, '', '<p>Choose the appropriate expression to complete the dia <br />Gita : Would you please be quiet? .... She is feeling unwell today. <br />Nada : I&rsquo;m sorry, I sing spontaneously when I hear my favorite song. <br />Gita : It&rsquo;s alright. I guess she doesn&rsquo;t hear you.</p>', '', '', '', '<p>I&rsquo;m trying to sleep</p>', '<p>My mother is sleeping</p>', '<p>I am sleeping soundly</p>', '<p>I am calling my mother</p>', '', '', '', '', '', '', '2', 1, 'T', 'T', '', '', '', ''),
(14266, 'BINGXII', 'XIIBING', 1, 34, '', '<p>Choose the appropriate expression to complete the dia<br /> Harris : I visited the National Monument yesterday. I think it is quite amazing. <br />Tamara : Yes, ... in 1961to commemorate the struggle of Indonesia for independence.<br /> Harris : My friends and I came down to Ruang Kemerdekaan</p>', '', '', '', '<p>it is constructed</p>', '<p>it was constructed</p>', '<p>it was constructing</p>', '<p>it has been constructed</p>', '', '', '', '', '', '', '2', 1, 'T', 'T', '', '', '', ''),
