(14268, 'BINGXII', 'XIIBING', 1, 36, '', '<p>9000 Park Avenue California 30133 09 June 2018 Mr Brown The Human Resource Division Goethe 517 Germany Dear Mr. Brown I am writing to you on the recommendation of Mr Clark, the General Manager in your company. I heard that you are seeking employees from everywhere around the world for one- year contract, and I would like to apply for the position on the post that you are offering. I graduated from Oxford University with degree in economics. I have an expertise in marketing department since 2010, for an investment company in California. I deal with a (36) ... range of investments from companies throughout Europe and Asia , buying shares and bonds from them on a worldwide basis. I also have a good working knowledge of german and mandarin. I would like to spend a year (37) ... Germany to gain more experiences in securities investment with this bank. My experience, training, and language skills would be useful to your company. I would be grateful if you could send me further information about the posts currently available. I can be reached at andy@gmail.com, Yours sincerely Andy Holmes&nbsp;</p>', '', '', '', '<p>long</p>', '<p>wide</p>', '<p>short</p>', '<p>narrow</p>', '', '', '', '', '', '', '2', 1, 'T', 'T', '', '', '', ''),
